import{_ as t,o as r,c as s,e as n}from"./app.db183534.js";const o={},g=n('<h2 id="\u865A\u62DF\u8BED\u6C14" tabindex="-1"><a class="header-anchor" href="#\u865A\u62DF\u8BED\u6C14" aria-hidden="true">#</a> \u865A\u62DF\u8BED\u6C14</h2><p>\u592A\u597D\u4E86\uFF01\u4F5C\u4E3A\u4F60\u7684\u82F1\u8BED\u4E13\u5BB6\u670B\u53CB\uFF0C\u6211\u4EEC\u4ECA\u5929\u6765\u6311\u6218\u82F1\u8BED\u8BED\u6CD5\u6BBF\u5802\u91CC\u7684\u201C\u6700\u540E\u4E00\u5EA7\u9AD8\u5CF0\u201D\u2014\u2014<strong>\u865A\u62DF\u8BED\u6C14</strong>\u3002\u522B\u88AB\u8FD9\u4E2A\u540D\u5B57\u5413\u5230\uFF0C\u5B83\u5176\u5B9E\u662F\u8868\u8FBE\u6211\u4EEC\u5FC3\u4E2D\u201C<strong>\u5982\u679C\u2026\u2026\u5C31\u597D\u4E86</strong>\u201D\u8FD9\u79CD\u60F3\u6CD5\u7684\u5F3A\u5927\u5DE5\u5177\u3002</p><p>\u6211\u4FDD\u8BC1\uFF0C\u7528\u6700\u751F\u6D3B\u5316\u7684\u65B9\u5F0F\uFF0C\u5E26\u4F60\u8F7B\u677E\u653B\u514B\u5B83\u3002</p><h3 id="\u7B2C\u4E00\u90E8\u5206-\u4EC0\u4E48\u662F\u865A\u62DF\u8BED\u6C14-\u5047\u5982-\u7684\u4E16\u754C" tabindex="-1"><a class="header-anchor" href="#\u7B2C\u4E00\u90E8\u5206-\u4EC0\u4E48\u662F\u865A\u62DF\u8BED\u6C14-\u5047\u5982-\u7684\u4E16\u754C" aria-hidden="true">#</a> <strong>\u7B2C\u4E00\u90E8\u5206\uFF1A\u4EC0\u4E48\u662F\u865A\u62DF\u8BED\u6C14\uFF1F\uFF08\u201C\u5047\u5982\u201D\u7684\u4E16\u754C\uFF09</strong></h3><p><strong>\u6838\u5FC3\u5FC3\u6CD5\uFF1A\u865A\u62DF\u8BED\u6C14\u7528\u6765\u63CF\u8FF0\u4E0E\u201C\u4E8B\u5B9E\u76F8\u53CD\u201D\u3001\u201C\u4E0D\u592A\u53EF\u80FD\u53D1\u751F\u201D\u6216\u201C\u7EAF\u7CB9\u5047\u8BBE\u201D\u7684\u60C5\u51B5\u3002\u5B83\u8C08\u8BBA\u7684\u662F\u4E00\u4E2A\u201C\u60F3\u8C61\u4E2D\u7684\u4E16\u754C\u201D\u3002</strong></p><p><strong>\u751F\u6D3B\u5316\u6BD4\u55BB\uFF1A</strong></p><ul><li><strong>\u9648\u8FF0\u8BED\u6C14</strong>\uFF1A\u662F<strong>\u65B0\u95FB\u62A5\u9053</strong>\uFF0C\u5BA2\u89C2\u63CF\u8FF0\u73B0\u5B9E\u4E16\u754C\u3002 -&gt; \u201C\u5916\u9762<strong>\u5728\u4E0B\u96E8</strong>\u3002\u201D\uFF08\u8FD9\u662F\u4E8B\u5B9E\uFF09</li><li><strong>\u865A\u62DF\u8BED\u6C14</strong>\uFF1A\u662F<strong>\u79D1\u5E7B\u5C0F\u8BF4</strong>\u6216<strong>\u8BB8\u613F\u74F6</strong>\uFF0C\u63CF\u8FF0\u4E00\u4E2A\u5047\u8BBE\u7684\u3001\u4E0E\u4E8B\u5B9E\u76F8\u53CD\u7684\u4E16\u754C\u3002 -&gt; \u201C<strong>\u5982\u679C</strong>\u73B0\u5728<strong>\u662F\u6674\u5929\u5C31\u597D\u4E86</strong>\u3002\u201D\uFF08\u4F46\u4E8B\u5B9E\u662F\uFF0C\u6B63\u5728\u4E0B\u96E8\uFF09</li></ul><p><strong>\u4E00\u53E5\u8BDD\u603B\u7ED3\uFF1A\u5F53\u4F60\u8BF4\u7684\u8BDD\u4E0D\u662F\u4E8B\u5B9E\uFF0C\u800C\u662F\u4F60\u7684\u613F\u671B\u3001\u5047\u8BBE\u3001\u5EFA\u8BAE\u6216\u4E0E\u4E8B\u5B9E\u76F8\u53CD\u7684\u68A6\u60F3\u65F6\uFF0C\u4F60\u5C31\u8981\u7528\u865A\u62DF\u8BED\u6C14\u3002</strong></p><hr><h3 id="\u7B2C\u4E8C\u90E8\u5206-\u865A\u62DF\u8BED\u6C14\u7684\u4E09\u5927\u4E3B\u6218\u573A" tabindex="-1"><a class="header-anchor" href="#\u7B2C\u4E8C\u90E8\u5206-\u865A\u62DF\u8BED\u6C14\u7684\u4E09\u5927\u4E3B\u6218\u573A" aria-hidden="true">#</a> <strong>\u7B2C\u4E8C\u90E8\u5206\uFF1A\u865A\u62DF\u8BED\u6C14\u7684\u4E09\u5927\u4E3B\u6218\u573A</strong></h3><p>\u865A\u62DF\u8BED\u6C14\u4E3B\u8981\u51FA\u73B0\u5728\u4E09\u79CD\u91CD\u8981\u7684\u573A\u666F\u4E2D\u3002\u6211\u4EEC\u4E00\u4E2A\u4E00\u4E2A\u6765\u770B\u3002</p><h4 id="\u6218\u573A\u4E00-\u4E0E\u4E8B\u5B9E\u76F8\u53CD\u7684\u5047\u8BBE-if\u6761\u4EF6\u53E5" tabindex="-1"><a class="header-anchor" href="#\u6218\u573A\u4E00-\u4E0E\u4E8B\u5B9E\u76F8\u53CD\u7684\u5047\u8BBE-if\u6761\u4EF6\u53E5" aria-hidden="true">#</a> <strong>\u6218\u573A\u4E00\uFF1A\u4E0E\u4E8B\u5B9E\u76F8\u53CD\u7684\u5047\u8BBE\uFF08If\u6761\u4EF6\u53E5\uFF09</strong></h4><p>\u8FD9\u662F\u865A\u62DF\u8BED\u6C14\u6700\u7ECF\u5178\u3001\u6700\u91CD\u8981\u7684\u7528\u6CD5\u3002\u5B83\u6709\u4E00\u5957\u6E05\u6670\u7684\u201C\u65F6\u95F4\u516C\u5F0F\u201D\u3002</p><table><thead><tr><th style="text-align:left;">\u5047\u8BBE\u7684\u65F6\u95F4</th><th style="text-align:left;"><strong>If \u4ECE\u53E5\u7684\u516C\u5F0F</strong> (\u6761\u4EF6)</th><th style="text-align:left;"><strong>\u4E3B\u53E5\u7684\u516C\u5F0F</strong> (\u7ED3\u679C)</th><th style="text-align:left;">\u4F8B\u53E5\u4E0E\u4E8B\u5B9E\u5206\u6790</th></tr></thead><tbody><tr><td style="text-align:left;"><strong>\u4E0E\u3010\u73B0\u5728\u3011\u4E8B\u5B9E\u76F8\u53CD</strong></td><td style="text-align:left;">If + \u4E3B\u8BED + <strong>\u52A8\u8BCD\u7684\u8FC7\u53BB\u5F0F</strong> <br>(be\u52A8\u8BCD\u7528<strong>were</strong>)</td><td style="text-align:left;">\u4E3B\u8BED + <strong>would/could/might + \u52A8\u8BCD\u539F\u5F62</strong></td><td style="text-align:left;"><strong>If I were</strong> you, <strong>I would study</strong> harder. <br>\uFF08<strong>\u5982\u679C\u6211\u662F</strong>\u4F60\uFF0C<strong>\u6211\u4F1A\u66F4\u52AA\u529B</strong>\u5B66\u4E60\u3002\uFF09 <br><strong>\u4E8B\u5B9E</strong>\uFF1A\u6211<strong>\u4E0D\u662F</strong>\u4F60\u3002</td></tr><tr><td style="text-align:left;"><strong>\u4E0E\u3010\u8FC7\u53BB\u3011\u4E8B\u5B9E\u76F8\u53CD</strong></td><td style="text-align:left;">If + \u4E3B\u8BED + <strong>had + \u8FC7\u53BB\u5206\u8BCD</strong></td><td style="text-align:left;">\u4E3B\u8BED + <strong>would/could/might + have + \u8FC7\u53BB\u5206\u8BCD</strong></td><td style="text-align:left;"><strong>If I had studied</strong> harder, <strong>I would have passed</strong> the exam. <br>\uFF08<strong>\u5982\u679C\u6211\u5F53\u65F6\u52AA\u529B</strong>\u5B66\u4E60\uFF0C<strong>\u6211\u672C\u53EF\u4EE5\u901A\u8FC7</strong>\u8003\u8BD5\u3002\uFF09 <br><strong>\u4E8B\u5B9E</strong>\uFF1A\u6211<strong>\u5F53\u65F6\u6CA1\u6709</strong>\u52AA\u529B\uFF0C\u6240\u4EE5<strong>\u6CA1\u901A\u8FC7</strong>\u3002</td></tr><tr><td style="text-align:left;"><strong>\u4E0E\u3010\u5C06\u6765\u3011\u4E8B\u5B9E\u76F8\u53CD</strong> <br>(\u53EF\u80FD\u6027\u6781\u5C0F)</td><td style="text-align:left;">If + \u4E3B\u8BED + <strong>should/were to + \u52A8\u8BCD\u539F\u5F62</strong></td><td style="text-align:left;">\u4E3B\u8BED + <strong>would/could/might + \u52A8\u8BCD\u539F\u5F62</strong></td><td style="text-align:left;"><strong>If it should rain</strong> tomorrow, <strong>we would cancel</strong> the trip. <br>\uFF08<strong>\u4E07\u4E00\u660E\u5929\u4E0B</strong>\u96E8\uFF0C<strong>\u6211\u4EEC\u4F1A\u53D6\u6D88</strong>\u884C\u7A0B\u3002\uFF09 <br><strong>\u4E8B\u5B9E</strong>\uFF1A\u6211\u4EEC\u8BA4\u4E3A\u660E\u5929<strong>\u57FA\u672C\u4E0D\u53EF\u80FD</strong>\u4E0B\u96E8\u3002</td></tr></tbody></table><p><strong>\u5FC3\u6CD5\u53E3\u8BC0\uFF1A</strong></p><ul><li><strong>\u73B0\u5728\u76F8\u53CD\uFF1A\u4ECE\u53E5\u7528\u8FC7\u53BB\uFF0C\u4E3B\u53E5\u7528would do\u3002</strong></li><li><strong>\u8FC7\u53BB\u76F8\u53CD\uFF1A\u4ECE\u53E5\u7528had done\uFF0C\u4E3B\u53E5\u7528would have done\u3002</strong></li><li><strong>\u5C06\u6765\u76F8\u53CD\uFF1A\u4ECE\u53E5\u7528should/were to do\uFF0C\u4E3B\u53E5\u7528would do\u3002</strong></li></ul><hr><h4 id="\u6218\u573A\u4E8C-\u8868\u8FBE\u613F\u671B-wish" tabindex="-1"><a class="header-anchor" href="#\u6218\u573A\u4E8C-\u8868\u8FBE\u613F\u671B-wish" aria-hidden="true">#</a> <strong>\u6218\u573A\u4E8C\uFF1A\u8868\u8FBE\u613F\u671B\uFF08Wish\uFF09</strong></h4><p>\u5F53\u6211\u4EEC\u7528 <code>wish</code> \u8868\u8FBE\u613F\u671B\u65F6\uFF0C\u6211\u4EEC\u613F\u671B\u7684\u5185\u5BB9\u901A\u5E38\u4E0E\u4E8B\u5B9E\u76F8\u53CD\uFF0C\u6240\u4EE5\u5FC5\u987B\u7528\u865A\u62DF\u8BED\u6C14\u3002\u5B83\u7684\u65F6\u6001\u516C\u5F0F\u548CIF\u53E5\u975E\u5E38\u50CF\u3002</p><table><thead><tr><th style="text-align:left;">\u613F\u671B\u7684\u65F6\u95F4</th><th style="text-align:left;"><strong>Wish\u540E\u9762\u7684\u4ECE\u53E5\u516C\u5F0F</strong></th><th style="text-align:left;">\u4F8B\u53E5\u4E0E\u4E8B\u5B9E\u5206\u6790</th></tr></thead><tbody><tr><td style="text-align:left;"><strong>\u5BF9\u3010\u73B0\u5728\u3011\u7684\u613F\u671B</strong></td><td style="text-align:left;">\u4E3B\u8BED + <strong>\u52A8\u8BCD\u7684\u8FC7\u53BB\u5F0F</strong> <br>(be\u52A8\u8BCD\u7528<strong>were</strong>)</td><td style="text-align:left;">I <strong>wish</strong> I <strong>had</strong> a car. <br>\uFF08\u6211\u771F\u5E0C\u671B\u6211<strong>\u6709</strong>\u4E00\u8F86\u8F66\u3002\uFF09 <br><strong>\u4E8B\u5B9E</strong>\uFF1A\u6211<strong>\u73B0\u5728\u6CA1\u6709</strong>\u8F66\u3002</td></tr><tr><td style="text-align:left;"><strong>\u5BF9\u3010\u8FC7\u53BB\u3011\u7684\u613F\u671B</strong> <br>(\u540E\u6094/\u9057\u61BE)</td><td style="text-align:left;">\u4E3B\u8BED + <strong>had + \u8FC7\u53BB\u5206\u8BCD</strong> <br>\u6216 <strong>could have + \u8FC7\u53BB\u5206\u8BCD</strong></td><td style="text-align:left;">I <strong>wish</strong> I <strong>had known</strong> the truth. <br>\uFF08\u6211\u771F\u5E0C\u671B\u6211<strong>\u5F53\u65F6\u77E5\u9053</strong>\u771F\u76F8\u3002\uFF09 <br><strong>\u4E8B\u5B9E</strong>\uFF1A\u6211<strong>\u5F53\u65F6\u4E0D\u77E5\u9053</strong>\u771F\u76F8\u3002</td></tr><tr><td style="text-align:left;"><strong>\u5BF9\u3010\u5C06\u6765\u3011\u7684\u613F\u671B</strong> <br>(\u4E0D\u592A\u53EF\u80FD\u5B9E\u73B0)</td><td style="text-align:left;">\u4E3B\u8BED + <strong>would/could + \u52A8\u8BCD\u539F\u5F62</strong></td><td style="text-align:left;">I <strong>wish</strong> it <strong>would stop</strong> raining. <br>\uFF08\u6211\u5E0C\u671B\u96E8<strong>\u80FD\u505C\u4E0B\u6765</strong>\u3002\uFF09 <br><strong>\u4E8B\u5B9E</strong>\uFF1A\u96E8\u770B\u6765<strong>\u4E00\u65F6\u534A\u4F1A\u513F\u505C\u4E0D\u4E86</strong>\u3002</td></tr></tbody></table><hr><h4 id="\u6218\u573A\u4E09-\u8868\u793A\u547D\u4EE4\u3001\u8981\u6C42\u3001\u5EFA\u8BAE\u7B49" tabindex="-1"><a class="header-anchor" href="#\u6218\u573A\u4E09-\u8868\u793A\u547D\u4EE4\u3001\u8981\u6C42\u3001\u5EFA\u8BAE\u7B49" aria-hidden="true">#</a> <strong>\u6218\u573A\u4E09\uFF1A\u8868\u793A\u547D\u4EE4\u3001\u8981\u6C42\u3001\u5EFA\u8BAE\u7B49</strong></h4><p>\u5728\u4E00\u4E9B\u8868\u793A<strong>\u547D\u4EE4\u3001\u8981\u6C42\u3001\u5EFA\u8BAE\u3001\u575A\u6301</strong>\u7684\u52A8\u8BCD\u540E\u9762\u7684\u4ECE\u53E5\u4E2D\uFF0C\u8981\u7528\u865A\u62DF\u8BED\u6C14\uFF0C\u5176\u5F62\u5F0F\u975E\u5E38\u56FA\u5B9A\uFF1A<strong>(should) + \u52A8\u8BCD\u539F\u5F62</strong>\u3002\u5728\u7F8E\u5F0F\u82F1\u8BED\u4E2D\uFF0C<code>should</code> \u7ECF\u5E38\u88AB\u7701\u7565\u3002</p><table><thead><tr><th style="text-align:left;">\u52A8\u8BCD\u7C7B\u578B</th><th style="text-align:left;">\u5173\u952E\u52A8\u8BCD</th><th style="text-align:left;">\u4F8B\u53E5\uFF08\u6CE8\u610F\u4ECE\u53E5\u4E2D\u7684\u52A8\u8BCD\u5F62\u5F0F\uFF09</th></tr></thead><tbody><tr><td style="text-align:left;"><strong>\u5EFA\u8BAE</strong></td><td style="text-align:left;">suggest, recommend, advise</td><td style="text-align:left;">I <strong>suggest</strong> that he <strong>(should) go</strong> at once. \uFF08\u6211\u5EFA\u8BAE\u4ED6<strong>\u7ACB\u5373\u53BB</strong>\u3002\uFF09</td></tr><tr><td style="text-align:left;"><strong>\u8981\u6C42</strong></td><td style="text-align:left;">demand, ask, request</td><td style="text-align:left;">She <strong>demanded</strong> that I <strong>(should) be</strong> there. \uFF08\u5979\u8981\u6C42\u6211<strong>\u5FC5\u987B</strong>\u5728\u54EA\u513F\u3002\uFF09</td></tr><tr><td style="text-align:left;"><strong>\u547D\u4EE4</strong></td><td style="text-align:left;">order, command</td><td style="text-align:left;">The general <strong>ordered</strong> that the city <strong>(should) be</strong> evacuated. \uFF08\u5C06\u519B\u547D\u4EE4<strong>\u64A4\u79BB</strong>\u8BE5\u57CE\u5E02\u3002\uFF09</td></tr><tr><td style="text-align:left;"><strong>\u575A\u6301</strong></td><td style="text-align:left;">insist</td><td style="text-align:left;">He <strong>insisted</strong> that we <strong>(should) stay</strong> for dinner. \uFF08\u4ED6\u575A\u6301\u8981\u6211\u4EEC<strong>\u7559\u4E0B</strong>\u5403\u665A\u996D\u3002\uFF09</td></tr></tbody></table><hr><h3 id="\u4E00\u4E2A\u6781\u5176\u91CD\u8981\u7684\u63D0\u9192-if\u7684\u7701\u7565\u4E0E\u5012\u88C5" tabindex="-1"><a class="header-anchor" href="#\u4E00\u4E2A\u6781\u5176\u91CD\u8981\u7684\u63D0\u9192-if\u7684\u7701\u7565\u4E0E\u5012\u88C5" aria-hidden="true">#</a> <strong>\u4E00\u4E2A\u6781\u5176\u91CD\u8981\u7684\u63D0\u9192\uFF1AIf\u7684\u7701\u7565\u4E0E\u5012\u88C5</strong></h3><p>\u5728\u4E0E\u201C\u73B0\u5728\u201D\u6216\u201C\u8FC7\u53BB\u201D\u4E8B\u5B9E\u76F8\u53CD\u7684\u5047\u8BBE\u4E2D\uFF0C\u5982\u679CIf\u4ECE\u53E5\u4E2D\u542B\u6709 <strong>were, had, should</strong> \u8FD9\u4E09\u4E2A\u8BCD\uFF0C\u6211\u4EEC\u53EF\u4EE5<strong>\u7701\u7565if\uFF0C\u5E76\u628A\u8FD9\u4E09\u4E2A\u8BCD\u63D0\u524D\u5230\u53E5\u9996</strong>\uFF0C\u6784\u6210\u5012\u88C5\u53E5\u3002\u8FD9\u542C\u8D77\u6765\u5F88\u6B63\u5F0F\u3001\u5F88\u6587\u5B66\u3002</p><ul><li><strong>\u6B63\u5E38</strong>\uFF1AIf I <strong>were</strong> you, I would not do it.</li><li><strong>\u5012\u88C5</strong>\uFF1A<strong>Were</strong> I you, I would not do it.</li><li><strong>\u6B63\u5E38</strong>\uFF1AIf I <strong>had known</strong> earlier, I would have told you.</li><li><strong>\u5012\u88C5</strong>\uFF1A<strong>Had</strong> I known earlier, I would have told you.</li></ul><hr><h3 id="\u603B\u7ED3\u4E0E\u5347\u534E" tabindex="-1"><a class="header-anchor" href="#\u603B\u7ED3\u4E0E\u5347\u534E" aria-hidden="true">#</a> <strong>\u603B\u7ED3\u4E0E\u5347\u534E</strong></h3><ol><li><strong>\u865A\u62DF\u8BED\u6C14\uFF08Subjunctive Mood\uFF09</strong> \u662F\u901A\u5F80\u201C\u60F3\u8C61\u4E16\u754C\u201D\u7684\u95E8\u7968\uFF0C\u7528\u6765\u8868\u8FBE<strong>\u975E\u4E8B\u5B9E</strong>\uFF08\u5047\u8BBE\u3001\u613F\u671B\u3001\u5EFA\u8BAE\uFF09\u3002</li><li><strong>\u4E09\u5927\u6838\u5FC3\u516C\u5F0F</strong>\uFF1A <ul><li><strong>If\u6761\u4EF6\u53E5</strong>\uFF1A\u65F6\u95F4\u5012\u9000\uFF08\u73B0\u5728\u7528\u8FC7\u53BB\u5F0F\uFF0C\u8FC7\u53BB\u7528\u8FC7\u53BB\u5B8C\u6210\uFF09\u3002</li><li><strong>Wish\u5BBE\u8BED\u4ECE\u53E5</strong>\uFF1A\u65F6\u95F4\u5012\u9000\uFF08\u540CIf\u53E5\uFF09\u3002</li><li><strong>\u5EFA\u8BAE/\u8981\u6C42\u7B49</strong>\uFF1A\u56FA\u5B9A\u4F7F\u7528 <strong>(should) + \u52A8\u8BCD\u539F\u5F62</strong>\u3002</li></ul></li><li><strong>\u7075\u9B42\u5728\u4E8E\u201C\u540E\u9000\u4E00\u6B65\u201D</strong>\uFF1A\u865A\u62DF\u8BED\u6C14\u7684\u7CBE\u9AD3\u5C31\u662F<strong>\u5728\u65F6\u6001\u4E0A\u201C\u540E\u9000\u4E00\u6B65\u201D</strong> \u6765\u8868\u8FBE\u4E0E\u4E8B\u5B9E\u7684\u80CC\u79BB\u3002 <ul><li>\u60F3\u8868\u8FBE\u4E0E<strong>\u73B0\u5728</strong>\u4E8B\u5B9E\u76F8\u53CD\uFF0C\u5C31\u7528<strong>\u8FC7\u53BB</strong>\u65F6\u6001\u3002</li><li>\u60F3\u8868\u8FBE\u4E0E<strong>\u8FC7\u53BB</strong>\u4E8B\u5B9E\u76F8\u53CD\uFF0C\u5C31\u7528<strong>\u8FC7\u53BB\u5B8C\u6210</strong>\u65F6\u6001\u3002</li></ul></li></ol><p>\u638C\u63E1\u4E86\u865A\u62DF\u8BED\u6C14\uFF0C\u4F60\u5C31\u80FD\u7545\u5FEB\u6DCB\u6F13\u5730\u8868\u8FBE\u4F60\u7684\u540E\u6094\u3001\u68A6\u60F3\u3001\u5047\u8BBE\u548C\u5EFA\u8BAE\u4E86\uFF01\u4ECE\u201CI am busy.\u201D\uFF08\u6211\u5F88\u5FD9\uFF09\u8FD9\u6837\u7684\u73B0\u5B9E\u9648\u8FF0\uFF0C\u5347\u7EA7\u5230\u201CI wish I weren\u2018t so busy.\u201D\uFF08\u6211\u771F\u5E0C\u671B\u6211\u6CA1\u8FD9\u4E48\u5FD9\uFF09\u8FD9\u6837\u5145\u6EE1\u60C5\u611F\u7684\u8868\u8FBE\u3002</p>',32),e=[g];function l(d,a){return r(),s("div",null,e)}var h=t(o,[["render",l],["__file","index.html.vue"]]);export{h as default};
